const Nickname = () => {
  return (
    <form className="nickname">
      <div className="form-control">
				<label></label>
        <input type="text" placeholder={"choose a nickname"} />
      </div>
      <input type="submit" value="enter" />
    </form>
  );
};

export default Nickname;
